import React from "react";

const Input = ({ fieldName, type = "text", label, placeholder }) => {
  return (
    <div className="form-group">
      <label for="name" className="form-label">
        {label}
      </label>
      <input
        className="form-control"
        type={type}
        name={fieldName}
        id={fieldName}
        placeholder={placeholder}
      />
    </div>
  );
};

export default Input;
